import React,{ useState } from 'react';
import logo from '../logo.svg'
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  Media,
  NavLink,
} from 'reactstrap';
const Header = (props) => {

  return(
    <div>
      <Navbar color="light" light expand="md">
        <NavbarBrand href="#">
          <Media>
            <Media left href="#">
              <Media object data-src={logo} alt="Generic placeholder image" />
            </Media>
          </Media>

        </NavbarBrand>
      </Navbar>
    </div>
  );

}

export default Header;
